const Map = () => {

    let map;
    function initMap() {
        var options = {
            center: { lat: 48.852024, lng: 2.28666 },
          zoom: 8,
        }
        map = google.maps.Map(document.getElementById("map"), options);
          
        }

    return(
        <div className="map">
            </div>
    )
}

export default Map;







